class AddNewRecipe extends React.Component{
    constructor(){
        super()
        this.state ={
            Cuisines: '',
            Diet: '',
            Intolerances: '',
            Types: ''
        }
    }
        handleChange = event => {
            if(event.target.id === 'Cuisines'){
                this.setState({
                    Cuisines: event.target.value
                })
            }else if(event.target.id === 'Diet'){
                this.setState({
                    Diet: event.target.value
                        })
            }else if(event.target.id === 'Intolerances'){
                this.setState({
                    Intolerances: event.target.value
                        })
            }else if(event.target.id === 'Types'){
                this.setState({
                    Types: event.target.value
                        })
            }
        }
        handleSubmit = event => {
            alert(`${this.state.Cuisines} ${this.state.Diet} ${this.state.Intolerances} ${this.state.Types}`)
            event.preventDefault()
        }
        render (){
            return ( 
                <form onSubmit={this.handleSubmit}>
            <label for="Cuisines">Which uisine eat today?:</label>
                        <select name="Cuisines" id="Cuisines" onChange={this.handleChange}>
                            <option value="African">African</option>
