                            <option value="Ovo-Vegetarian">Ovo-Vegetarian</option>
                            <option value="Vegan">Vegan</option>
                            <option value="Pescetarian">Pescetarian</option>
                            <option value="Paleo">Paleo</option>
                            <option value="Primal">Primal</option>
                            <option value="Low FODMAP">Low FODMAP</option>
                            <option value="Lacto-Vegetarian">Lacto-Vegetarian</option>
                            <option value="Ovo-Vegetarian">Ovo-Vegetarian</option>
                            <option value="Vegan">Vegan</option>
                            <option value="Whole30">Whole30</option>
                        </select><br/>
                        <label for='Intolerances'>Do you have any Intolerances?</label>
                        <select name='Intolerances' id='Intolerances' onChange={this.handleChange}>
                            <option value="Dairy">Dairy</option>
                            <option value="Egg">Egg</option>
                            <option value="Gluten">Gluten</option>
                            <option value="Grain">Grain</option>
                            <option value="Peanut">Peanut</option>
                            <option value="Seafood">Seafood</option>
                            <option value="Sesame">Sesame</option>
                            <option value="Shellfish">Shellfish</option>
                            <option value="Soy">Soy</option>
                            <option value="Sulfite">Sulfite</option>
                            <option value="Tree Nut">Tree Nut</option>
                            <option value="Wheat">Wheat</option>
                        </select><br/>
                        <label for='Types'>And choice wich meal type you wanna see?</label>
                        <select name='Types' id='Types' onChange={this.handleChange}>
                            <option value="main course">main course</option>
                            <option value="side dish">side dish</option>
                            <option value="dessert">dessert</option>
                            <option value="appetizer">appetizer</option>
                            <option value="salad">salad</option>
                            <option value="bread">bread</option>
                            <option value="breakfast">breakfast</option>
                            <option value="soup">soup</option>
                            <option value="sauce">sauce</option>
                            <option value="marinade">marinade</option>
                            <option value="fingerfood">fingerfood</option>
                            <option value="snack">snack</option>
                            <option value="drink">drink</option>
                        </select><br/>
                        <button onClick={SeeRecipes()}>See the recipes we find for you</button>
       </form>
       )}

}

